import React from 'react';
import LiveCard from "./LiveCard";
import Home from '../Home'

class CitySearch extends React.Component {




	render(){

		return (

			<div>
			<form onClick={this.props.searchHandle}>
                <label>City:
                <input type="text"  name="city" onChange={this.props.handleChange} placeholder="Enter a City" />
                </label>
                <input type="submit"  value="Go" />
            </form>
			<LiveCard weather={this.props.weather} />
		</div>
	);
	}
}


export default CitySearch;
